stabilizers = stabilizers_raw.strip().split('\n')
print(f"Number of stabilizers: {len(stabilizers)}")
print(f"Length of each stabilizer: {len(stabilizers[0])}")

# Convert strings to PauliString objects
pauli_strings = [stim.PauliString(s) for s in stabilizers]
print(f"Converted to {len(pauli_strings)} PauliStrings")

# Find all anticommuting pairs
anticommuting = []
for i in range(len(pauli_strings)):
    for j in range(i+1, len(pauli_strings)):
        if pauli_strings[i].commutes(pauli_strings[j]) == False:
            anticommuting.append((i, j))

print(f"\nFound {len(anticommuting)} anticommuting pairs:")
for i, j in anticommuting[:20]:
    print(f"  {i} and {j}")
if len(anticommuting) > 20:
    print(f"  ... and {len(anticommuting) - 20} more")

# Count how many conflicts each stabilizer has
conflict_count = {}
for i in range(len(pauli_strings)):
    conflict_count[i] = 0
for i, j in anticommuting:
    conflict_count[i] += 1
    conflict_count[j] += 1

# Find stabilizers sorted by number of conflicts
sorted_by_conflicts = sorted(conflict_count.items(), key=lambda x: x[1], reverse=True)
print(f"\nTop 10 stabilizers by conflict count:")
for idx, count in sorted_by_conflicts[:10]:
    print(f"  Stab {idx}: {count} conflicts")

# Greedy: remove stabilizers with most conflicts until no conflicts remain
to_remove = set()
remaining_pairs = list(anticommuting)
while remaining_pairs:
    # Count conflicts among remaining stabilizers
    counts = {}
    for i, j in remaining_pairs:
        if i not in to_remove:
            counts[i] = counts.get(i, 0) + 1
        if j not in to_remove:
            counts[j] = counts.get(j, 0) + 1
    # Remove the one with most conflicts
    if counts:
        worst = max(counts, key=counts.get)
        to_remove.add(worst)
        remaining_pairs = [(i, j) for i, j in remaining_pairs if i != worst and j != worst]

print(f"\nRemoving {len(to_remove)} stabilizers: {sorted(to_remove)}")

# Build the commuting subset
commuting_stabilizers = [s for i, s in enumerate(pauli_strings) if i not in to_remove]
print(f"Remaining: {len(commuting_stabilizers)} stabilizers")

# Generate circuit
try:
    tab = stim.Tableau.from_stabilizers(commuting_stabilizers, allow_redundant=True, allow_underconstrained=True)
    circuit = tab.to_circuit()
    print("\nCircuit generated successfully!")
    print(f"Circuit has {len(circuit)} instructions")
    
    # Save the circuit
    with open("circuit_175_v6.stim", "w") as f:
        f.write(str(circuit))
    print("\nSaved to circuit_175_v6.stim")
    print("\n=== CIRCUIT ===")
    print(circuit)
except Exception as e:
    print(f"Error: {e}")